css:
body.fullscreen .title-bar {
  margin-top: -23px;
}
.title-bar {
  height: 23px;
  transition: margin-top 160ms;
  flex-shrink: 0;
  display: flex;
  align-items: center;
  justify-content: center;
  font-size: 13px;
  -webkit-user-select: none;
  -webkit-app-region: drag;
  padding: 0 70px;
  overflow: hidden;
  background-color: #f4f4f4;
  border-bottom: 1px solid #9f9f9f;
}
.title-bar .title {
  flex: 0 1 auto;
  overflow: hidden;
  white-space: nowrap;
  text-overflow: ellipsis;
}
.is-blurred .title-bar {
  color: #999999;
}
